import React from 'react'
import "./sidebar.css";
import Button from '@material-ui/core/Button';



function sidebar() {
    return (
        <div className="sidebar">
            <h1>iam a sidebar</h1>
            <span class="material-icons">
               account_circle
            </span>
            <Button variant="contained" color="primary">
               Hello World
            </Button>

        </div>
    )
}

export default sidebar;
